import "./App.css";
import React, { Component } from "react";

class DisplayThings extends Component {
  constructor(props) {
    super(props);

    this.state = {
      time: "1111",
    };
  }

  componentDidMount() {
    this.getTime();
  }

  getTime() {
    fetch("http://localhost:3001")
      .then((response) => {
        return response.text();
      })
      .then((response) => {
        this.setState({ time: response });
        console.log(response);
      });
  }
  render() {
    return <App time={this.state.time} />;
  }
}

function App(time) {
  var time = "null";
  return (
    <div className="App">
      <header className="App-header">
        <p>The time is {time}.</p>
